  DialogActions,
  Button,
  Grid,
  TextField,
  IconButton,
  Divider,
  List,
  ListItem,
  ListItemIcon,
  ListItemText,
  Alert
} from '@mui/material';
import { 
  Description as DocumentationIcon, 
  Email as EmailIcon,
  Close as CloseIcon,
  ArrowForward as ArrowForwardIcon,
  Settings as SettingsIcon,
  Info as InfoIcon,
  HelpOutline as HelpIcon,
  Build as BuildIcon,
  Security as SecurityIcon
} from '@mui/icons-material';

const Footer = () => {
  const [docDialogOpen, setDocDialogOpen] = useState(false);
  const [supportDialogOpen, setSupportDialogOpen] = useState(false);
  const [contactForm, setContactForm] = useState({
    name: '',
    email: '',
    subject: '',
    message: ''
  });
  const [formSubmitted, setFormSubmitted] = useState(false);

  const handleDocDialogOpen = () => {
    setDocDialogOpen(true);
  };

  const handleDocDialogClose = () => {
    setDocDialogOpen(false);
  };

  const handleSupportDialogOpen = () => {
    setSupportDialogOpen(true);
    setFormSubmitted(false);
  };

  const handleSupportDialogClose = () => {
    setSupportDialogOpen(false);
    // Reset form when closing
    setContactForm({
      name: '',
      email: '',
      subject: '',
      message: ''
    });
  };

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setContactForm({
      ...contactForm,
      [name]: value
    });
  };

  const handleSubmitForm = (e) => {
    e.preventDefault();
    console.log('Support form submitted:', contactForm);
    // In a real app, you would send this data to your backend
    // For now, we'll just simulate a successful submission
    setFormSubmitted(true);

    // Optional: Send an email directly (only works if user has email client configured)
    window.open(`mailto:support@mavenanalyzer.com?subject=${encodeURIComponent(contactForm.subject)}&body=${encodeURIComponent(`Name: ${contactForm.name}\nEmail: ${contactForm.email}\n\n${contactForm.message}`)}`);
  };

  return (
    <Box
      component="footer"
      sx={{
        py: 3,
        px: 2,
        mt: 'auto',
        backgroundColor: (theme) => 
          theme.palette.mode === 'light' ? theme.palette.grey[100] : theme.palette.grey[900],
      }}
    >
      <Container maxWidth="lg">
        <Typography variant="body2" color="text.secondary" align="center">
          {'© '}
          {new Date().getFullYear()}
          {' '}
          <Link color="inherit" href="#">
            Maven Dependency Analyzer
          </Link>
          {' | '}
          <Link 
            color="inherit" 
            href="#" 
            onClick={(e) => {
              e.preventDefault();
              handleDocDialogOpen();
            }}
          >
            Documentation
          </Link>
          {' | '}
          <Link 
            color="inherit" 
            href="#" 
            onClick={(e) => {
              e.preventDefault();
              handleSupportDialogOpen();
            }}
          >
            Support
          </Link>
        </Typography>
      </Container>

      {/* Documentation Dialog */}
      <Dialog
        open={docDialogOpen}
        onClose={handleDocDialogClose}
        maxWidth="md"
        fullWidth
      >
        <DialogTitle>
          <Grid container alignItems="center" justifyContent="space-between">
            <Grid item>
              <Box display="flex" alignItems="center">
                <DocumentationIcon sx={{ mr: 1 }} />
                <Typography variant="h6">Maven Dependency Analyzer Documentation</Typography>
              </Box>
            </Grid>
            <Grid item>
              <IconButton onClick={handleDocDialogClose} edge="end">
                <CloseIcon />
              </IconButton>
            </Grid>
          </Grid>
        </DialogTitle>
        <Divider />
        <DialogContent>
          <Grid container spacing={3}>
            <Grid item xs={12} md={4}>
              <Typography variant="h6" gutterBottom>
                Quick Guide
              </Typography>
              <List>
                <ListItem button component="a" href="#">
                  <ListItemIcon>
                    <InfoIcon color="primary" />
                  </ListItemIcon>
                  <ListItemText primary="Getting Started" />
                </ListItem>
                <ListItem button component="a" href="#">
                  <ListItemIcon>
                    <BuildIcon color="primary" />
                  </ListItemIcon>
                  <ListItemText primary="Managing Projects" />
                </ListItem>
                <ListItem button component="a" href="#">
                  <ListItemIcon>
                    <SecurityIcon color="primary" />
                  </ListItemIcon>
                  <ListItemText primary="Security Analysis" />
                </ListItem>
                <ListItem button component="a" href="#">
                  <ListItemIcon>
                    <SettingsIcon color="primary" />
                  </ListItemIcon>
                  <ListItemText primary="Configuration" />
                </ListItem>
                <ListItem button component="a" href="#">
                  <ListItemIcon>
                    <HelpIcon color="primary" />
                  </ListItemIcon>
                  <ListItemText primary="FAQ" />
                </ListItem>
              </List>
            </Grid>
            <Grid item xs={12} md={8}>
              <Typography variant="h6" gutterBottom>
                About Maven Dependency Analyzer
              </Typography>
              <Typography paragraph>
                Maven Dependency Analyzer is a powerful tool designed to help developers manage and analyze their Maven project dependencies.
                It provides insights into outdated dependencies, security vulnerabilities, and license compliance issues.
              </Typography>
              <Typography paragraph>
                The tool scans your Maven POM files, analyzes the dependencies, and provides recommendations for updates and security patches.
                It also generates reports that can be shared with your team or stakeholders.
              </Typography>
              <Typography variant="h6" gutterBottom>
                Key Features
              </Typography>
              <List>
                <ListItem>
                  <ListItemIcon>✓</ListItemIcon>
                  <ListItemText primary="Dependency version checking and update recommendations" />
                </ListItem>
                <ListItem>
                  <ListItemIcon>✓</ListItemIcon>
                  <ListItemText primary="Security vulnerability scanning and alerts" />
                </ListItem>
                <ListItem>
                  <ListItemIcon>✓</ListItemIcon>
                  <ListItemText primary="License compliance monitoring" />
                </ListItem>
                <ListItem>
                  <ListItemIcon>✓</ListItemIcon>
                  <ListItemText primary="Detailed reports and visualizations" />
                </ListItem>
                <ListItem>
                  <ListItemIcon>✓</ListItemIcon>
                  <ListItemText primary="Exportable results and recommended POM updates" />
                </ListItem>
              </List>
            </Grid>
          </Grid>
        </DialogContent>
        <DialogActions>
          <Button 
            onClick={handleDocDialogClose} 
            color="primary"
          >
            Close
          </Button>
          <Button 
            variant="contained" 
            endIcon={<ArrowForwardIcon />}
            onClick={() => {
              window.open("https://github.com/your-repo/maven-analyzer", "_blank");
              handleDocDialogClose();
            }}
          >
            Full Documentation
          </Button>
        </DialogActions>
      </Dialog>

      {/* Support Dialog */}
      <Dialog
        open={supportDialogOpen}
        onClose={handleSupportDialogClose}
        maxWidth="sm"
        fullWidth
      >
        <DialogTitle>
          <Grid container alignItems="center" justifyContent="space-between">
            <Grid item>
              <Box display="flex" alignItems="center">
                <EmailIcon sx={{ mr: 1 }} />
                <Typography variant="h6">Contact Support</Typography>
              </Box>
            </Grid>
            <Grid item>
              <IconButton onClick={handleSupportDialogClose} edge="end">
                <CloseIcon />
              </IconButton>
            </Grid>
          </Grid>
        </DialogTitle>
        <Divider />
        <DialogContent>
          {formSubmitted ? (
            <Box mt={2} mb={2}>
              <Alert severity="success">
                Thank you for contacting support! We'll get back to you as soon as possible.
              </Alert>
            </Box>
          ) : (
            <form onSubmit={handleSubmitForm}>
              <Grid container spacing={2}>
                <Grid item xs={12} sm={6}>
                  <TextField
                    name="name"
                    label="Your Name"
                    fullWidth
                    required
                    value={contactForm.name}
                    onChange={handleInputChange}
                  />
                </Grid>
                <Grid item xs={12} sm={6}>
                  <TextField
                    name="email"
                    label="Email Address"
                    fullWidth
                    required
                    type="email"
                    value={contactForm.email}
                    onChange={handleInputChange}
                  />
                </Grid>
                <Grid item xs={12}>
                  <TextField
                    name="subject"
                    label="Subject"
                    fullWidth
                    required
                    value={contactForm.subject}
                    onChange={handleInputChange}
                  />
                </Grid>
                <Grid item xs={12}>
                  <TextField
                    name="message"
                    label="Message"
                    fullWidth
                    required
                    multiline
                    rows={4}
                    value={contactForm.message}
                    onChange={handleInputChange}
                  />
                </Grid>
              </Grid>
            </form>
          )}
        </DialogContent>
        <DialogActions>
          <Button onClick={handleSupportDialogClose} color="primary">
            Cancel
          </Button>
          {!formSubmitted && (
            <Button 
              type="submit" 
              variant="contained" 
              color="primary" 
              endIcon={<EmailIcon />}
              onClick={handleSubmitForm}
            >
              Send Message
            </Button>
          )}
        </DialogActions>
      </Dialog>
    </Box>
  );
};

export default Footer;
